import React from "react";

export default function Gewerbekunden() {
  return (
    <div className="min-h-screen bg-gray-900 text-white p-6">
      <div className="max-w-3xl mx-auto">
        <h1 className="text-3xl font-bold text-yellow-400 mb-4">Für Gewerbekunden</h1>
        <p>Individuelle Stromangebote auf Basis aktueller Börsenpreise.</p>
      </div>
    </div>
  );
}
